import React, { Component } from 'react';

class dublicateCoce extends Component {

    state = ({ flag: false, title: 'Show' });

    displayMe = () => {

        this.setState({ flag: !this.state.flag });
        
        if( this.state.flag )
            this.setState({ title: 'Hide' });
        else  
            this.setState({ title: 'Show' });
    }
}

export default HOC;
